def gcd(a,b):
    if b>a:
        return gcd(b,a)
    if b == 0:
        return a
    return gcd(b,a%b)

def extgcd(a,b):
    r = [1,0,a]
    w = [0,1,b]
    while w[2] != 1:
        q = r[2]//w[2]
        r2 = w
        w2 = [r[0]-q*w[0],r[1]-q*w[1],r[2]-q*w[2]]
        r = r2
        w = w2
    return w[0],w[1]

n = int(input())
p = list(map(int,input().split()))
q = list(map(int,input().split()))

dp = [[0]*401 for _ in range(201)]
for i in range(1,n+1):
    dp[i][0] = i
    dp[i][1] = q[i-1]

for j in range(2,401):
    for i in range(1,n+1):
        dp[i][j] = dp[dp[i][j-1]][1]

ab = [[0,0] for _ in range(n)]
for i in range(n):
    pi = p[i]
    bi = -1
    for b in range(401):
        if dp[pi][b] == i+1:
            bi = b
            break
    if bi == -1:
        print(-1)
        exit()

    ai = -1
    for a in range(1,401):
        if dp[pi][a] == pi:
            ai = a
            break
    ab[i] = [ai,bi]

tmp_a = ab[0][0]
tmp_b = ab[0][1]
for i in range(1,n):
    A = tmp_a
    B = ab[i][0]
    C = ab[i][1]-tmp_b

    G= gcd(A,B)
    if C%G != 0:
        print(-1)
        exit()
    K1,K2 = extgcd(A//G,B//G)
    tmp_a = G*(A//G)*(B//G)
    K1 *= C//G
    tmp_b = A * K1 + tmp_b
    tmp_b = (tmp_b % tmp_a + tmp_a) % tmp_a
print(tmp_b)
